// ==UserScript==
// @name         网页翻译——自动翻译为中文
// @author       Kaiter-Plus &  人民的勤务员 <toniaiwanowskiskr47@gmail.com>
// @namespace    https://gitee.com/Kaiter-Plus/TampermonkeyScript/tree/master/Translate/Translate_only_chinese.js
// @description  给每个非中文的网页右下角（可以调整到左下角）添加一个google翻译图标，该版本为中文翻译版本，只把外语翻译为中文,添加自动翻译
// @version 0.31.0.5
// @license      BSD-3-Clause
// @include      *://*
// @exclude      /^(http|https).*((2(5[0-5]|[0-4]\d))|[0-1]?\d{1,2})(\.((2(5[0-5]|[0-4]\d))|[0-1]?\d{1,2})){3}/
// @exclude      /.*duyaoss\.com/
// @exclude      /.*lanzous\.com/
// @exclude      /.*w3school.*cn/
// @exclude      /.*iqiyi\.com/
// @exclude      /.*baidu.*/
// @exclude      /.*cnblogs\.com/
// @exclude      /.*csdn\.net/
// @exclude      /.*zhku\.edu\.cn/
// @exclude      /.*zhihuishu\.com/
// @exclude      /.*aliyuncs\.com/
// @exclude      /.*chaoxing\.com/
// @exclude      /.*youku\.com/
// @exclude      /.*examcoo\.com/
// @exclude      /.*mooc\.com/
// @exclude      /.*bilibili\.com/
// @exclude      /.*qq\.com/
// @exclude      /.*yy\.com/
// @exclude      /.*huya\.com/
// @exclude      /localhost/
// @exclude      /.*acfun\.cn/
// @exclude      /.*eleme\.cn/
// @exclude      /.*douyin\.com/
// @icon         data:image/png;base64,
// @noframes
// @grant        GM_addStyle
// @grant        GM_setValue
// @grant        GM_getValue
// @grant        GM_notification
// @grant        GM_registerMenuCommand
// @grant        GM_unregisterMenuCommand
// ==/UserScript==

; (function () {
    'use strict'

    const supportApplet =
        'data:image/png;base64,'

    // 取消没有用的图片请求
    const pointTimer = setInterval(() => {
        const banner = document.getElementById(':2.container')
        if (banner) {
            const doc = banner.contentWindow.document || banner.contentDocument
            const imgs = doc.getElementsByTagName('img')
            for (let i = 0; i < imgs.length; i++) {
                imgs[i].src = ''
            }
            clearInterval(pointTimer)
        }
    }, 10)

    // 菜单
    const menu = [
        {
            key: 'position',
            name: '按钮位置',
            value: true,
            showNotification: true,
            tip: {
                open: '👈',
                close: '👉'
            },
            click: setButtonPosition
        },
        {
            key: 'isCheck',
            name: '自动检测中文',
            value: true,
            showNotification: true,
            tip: {
                open: '✅',
                close: '❌'
            },
            click: null
        },
        {
            key: 'isShowTip',
            name: '显示翻译建议',
            value: false,
            showNotification: true,
            tip: {
                open: '✅',
                close: '❌'
            },
            click: setShowTip
        },
        {
            key: 'setHotkey',
            name: '设置快捷键',
            value: false,
            showNotification: false,
            tip: {
                open: '',
                close: ''
            },
            click: openSettings
        },
        {
            key: 'support',
            name: '赞助一下作者',
            value: false,
            showNotification: false,
            tip: {
                open: '',
                close: ''
            },
            click: openSupport
        }
    ]

    // 保存已注册的菜单
    const munuRegister = []

    // 配置默认菜单
    menu.forEach(v => {
        if (GM_getValue(v.key) === undefined || GM_getValue(v.key) === null) GM_setValue(v.key, v.value)
    })

    // 注册菜单
    function registerMenuCommand() {
        if (munuRegister.length === menu.length) {
            munuRegister.forEach(v => {
                GM_unregisterMenuCommand(v)
            })
        }
        menu.forEach((v, i) => {
            v.value = GM_getValue(v.key)
            munuRegister[i] = GM_registerMenuCommand(`${v.value ? v.tip.open : v.tip.close} ${v.name}`, () => {
                menuSwitch(v)
            })
        })
    }

    // 切换菜单
    function menuSwitch(item) {
        // 设置数据
        item.value = !item.value
        GM_setValue(item.key, item.value)
        // 系统通知
        if (item.showNotification) {
            GM_notification({
                text: `已${item.value ? item.tip.open : item.tip.close}[${item.name}] 功能`,
                title: '网页翻译',
                timeout: 1000
            })
        }
        // 如果有点击事件，执行
        if (item.click) item.click()
        // 重新注册
        registerMenuCommand()
    }

    // 打开设置快捷键弹窗
    function openSupport() {
        document.getElementById('k-support-wrap').classList.add('show')
        document.getElementById('k-support-content').classList.add('show')
    }

    // 获取 head
    const head = document.head
    // 获取body
    const body = document.body
    // 获取当前页面的语言
    const lang = document.documentElement.lang
    // 获取网页的标题
    const pageTitle = document.title
    // 获取网页使用的主要语言
    const mainLang = document.characterSet.toLowerCase()

    // 判断是不是中文网页
    function isChinesePage() {
        // 获取网页标题
        const pageTitle = document.title

        // 获取网页语言
        const lang = document.documentElement.lang
        const mainLang = document.characterSet.toLowerCase()

        // 定义日文字符的正则表达式
        const japaneseRegex = /[\u30A1-\u30FA\u30FD-\u30FF][\u3099\u309A\u30A1-\u30FF]*[\u3099\u309A\u30A1-\u30FA\u30FC-\u30FF]|[\uFF66-\uFF6F\uFF71-\uFF9D][\uFF65-\uFF9F]*[\uFF66-\uFF9F]/
        // /[\u3040-\u30FF\u31F0-\u31FF\uFF66-\uFF9F]/
        //      /[\u30A1-\u30FA\u30FD-\u30FF][\u3099\u309A\u30A1-\u30FF]*[\u3099\u309A\u30A1-\u30FA\u30FC-\u30FF]|[\uFF66-\uFF6F\uFF71-\uFF9D][\uFF65-\uFF9F]*[\uFF66-\uFF9F]/
        // 如果网页标题中包含日文字符，则返回false
        if (japaneseRegex.test(pageTitle)) {
            return false
        }

        // 定义中文字符的正则表达式
        const chineseRegex = /[\u4E00-\u9FFF]/

        // 如果网页语言是中文、英文或网页标题含有中文字符，则返回true
        return (
            GM_getValue('isCheck') &&
            (lang.substring(0, 2) === 'zh' || mainLang.substring(0, 2) === 'gb' || chineseRegex.test(pageTitle))
        )
    }

    // 打开设置快捷键弹窗
    function openSettings() {
        document.querySelector('.hotkey-settings').classList.add('show')
        document.querySelector('.hotkey-settings__container').classList.add('show')
    }

    // 位置信息样式
    let positionStyle = null
    // 设置按钮位置
    function setButtonPosition() {
        if (positionStyle) positionStyle.parentNode.removeChild(positionStyle)
        positionStyle = GM_addStyle(`
      .buttonContainer {
        ${GM_getValue('position') ? 'left' : 'right'}: 0;
        transform: translateX(${GM_getValue('position') ? '-' : ''}80%);
      }
    `)
    }

    // 显示翻译建议信息
    let tipStyle = null
    function setShowTip() {
        if (tipStyle) tipStyle.parentNode.removeChild(tipStyle)
        tipStyle = GM_addStyle(`
      #goog-gt- {
        visibility: ${GM_getValue('isShowTip') ? 'visible' : 'hidden!important'};
        display: ${GM_getValue('isShowTip') ? 'block' : 'none!important'};
      }
      .goog-text-highlight {
        background-color: ${GM_getValue('isShowTip') ? '#c9d7f1' : 'inherit!important'};
        box-shadow: ${GM_getValue('isShowTip') ? '2 2 4 #99a' : '0 0 0 0 transparent!important'};
      }
    `)
    }

    // 注册菜单
    registerMenuCommand()

    const keyName = ['translate', 'recover']
    let hotkey = GM_getValue('hotkey')
    hotkey = hotkey ? hotkey : []

    const exclude = /control|shift|alt/

    // 设置按钮
    function setting() {
        document.getElementById(`i-hotkey`).value = '松开手指即可设置完成！'
        document.removeEventListener('keydown', clickHotkey)
        document.addEventListener('keyup', setHotkey)
    }

    // 开始设置
    function setHotkey(e) {
        hotkey = []
        if (!exclude.test(e.key.toLowerCase())) {
            if (e.ctrlKey) hotkey.push('ctrl')
            if (e.shiftKey) hotkey.push('shift')
            if (e.altKey) hotkey.push('alt')
            hotkey.push(e.key)
            // 保存键值
            GM_setValue('hotkey', hotkey)
            document.getElementById(`i-hotkey`).value = `${hotkey.join(' + ')}`
            // 设置完成移除事件
            document.removeEventListener('keyup', setHotkey)
        }
    }

    // 按键按下事件
    document.addEventListener('keydown', clickHotkey)

    // 快捷键
    function clickHotkey(e) {
        const keys = []
        if (!exclude.test(e.key.toLowerCase())) {
            if (e.ctrlKey) keys.push('ctrl')
            if (e.shiftKey) keys.push('shift')
            if (e.altKey) keys.push('alt')
            keys.push(e.key)
            let key = ''
            if (hotkey[0] && hotkey.length === keys.length) {
                const isRight = hotkey.every(v => {
                    return keys.indexOf(v) > -1
                })
                if (isRight) {
                    const reg = /googtrans=\/auto\/zh-CN/g
                    key = reg.test(document.cookie) ? keyName[1] : keyName[0]
                }
            }
            if (key) document.getElementById(`${key}Button`).click()
        }
    }

    // 关闭按钮
    function closeSettings() {
        document.querySelector('.hotkey-settings').classList.remove('show')
        document.querySelector('.hotkey-settings__container').classList.remove('show')
        // 重新添加按键按下事件
        document.addEventListener('keydown', clickHotkey)
    }

    // 快捷键设置结构
    function inttSettingsUI() {
        // 主要容器
        const settings = document.createElement('div')
        settings.className = 'hotkey-settings'
        // 弹窗容器
        const container = document.createElement('div')
        container.className = 'hotkey-settings__container'
        // 关闭按钮
        const close = document.createElement('div')
        close.className = 'hotkey-settings__close'
        close.textContent = '×'
        close.addEventListener('click', closeSettings)
        // 标题
        const header = document.createElement('div')
        header.className = 'hotkey-settings__header'
        header.textContent = '快捷键设置'
        // 设置区域
        const content = document.createElement('div')
        content.className = 'hotkey-settings__content'
        // 提示
        const tip = document.createElement('div')
        tip.className = 'hotkey-settings__tip'
        tip.textContent = '目前支持的快捷键附加键有：Ctrl, Shift, Alt'
        // 设置区域内容
        const contentItem = document.createElement('div')
        contentItem.className = 'hotkey-settings__content-item'
        const title = document.createElement('span')
        title.className = 'hotkey-settings__title'
        title.textContent = '快捷键：'
        const input = document.createElement('input')
        input.id = `i-hotkey`
        input.disabled = true
        input.className = 'hotkey-input'
        if (hotkey[0]) {
            input.value = hotkey.join(' + ')
        } else {
            input.value = '还没有设置快捷键哦~'
        }
        input.setAttribute('type', 'text')
        const button = document.createElement('button')
        button.id = `b--hotkey`
        button.className = 'hotkey-button'
        button.textContent = '设置'
        button.addEventListener('click', e => setting())
        contentItem.appendChild(title)
        contentItem.appendChild(input)
        contentItem.appendChild(button)
        content.appendChild(contentItem)
        container.appendChild(close)
        container.appendChild(header)
        container.appendChild(content)
        container.appendChild(tip)
        settings.appendChild(container)
        document.body.appendChild(settings)
    }

    // 设置快捷键的样式
    function addHotkeyStyle() {
        GM_addStyle(`
      .hotkey-settings {
        position: fixed;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        z-index: 999999999;
        backdrop-filter: blur(10px);
        display: flex;
        justify-content: center;
        align-items: center;
        font-size: 16px;
        color: #606266;
        visibility: hidden;
      }

      .hotkey-settings.show {
        visibility: visible;
      }

      .hotkey-settings .hotkey-settings__container {
        width: 400px;
        border-radius: 6px;
        box-shadow: 0 2px 12px 0 rgba(0, 0, 0, 10%);
        background-color: #fff;
        transform: scale(0);
        position: relative;
        transition: transform 0.3s;
      }

      .hotkey-settings__container.show {
        transform: scale(1);
      }

      .hotkey-settings__container .hotkey-settings__close {
        width: 20px;
        height: 20px;
        line-height: 21px;
        border-radius: 50%;
        text-align: center;
        color: #fff;
        font-weight: bold;
        background-color: #F56C6C;
        position: absolute;
        top: -6px;
        right: -6px;
        user-select: none;
      }

      .hotkey-settings__container .hotkey-settings__close:hover {
        opacity: 0.7;
      }

      .hotkey-settings__container .hotkey-settings__header {
        padding: 0 12px;
        height: 30px;
        line-height: 30px;
        display: flex;
        justify-content: space-between;
        align-items: center;
      }

      .hotkey-settings__container .hotkey-settings__content {
        padding: 0 12px;
      }

      .hotkey-settings__container .hotkey-settings__tip {
        padding: 12px;
        color: #909399;
      }

      .hotkey-settings__container .hotkey-settings__content .hotkey-settings__content-item {
        display: flex;
        align-items: center;
      }

      .hotkey-settings__container .hotkey-settings__content .hotkey-input {
        flex: 1;
        -webkit-appearance: none;
        background-color: #fff;
        background-image: none;
        border-radius: 4px;
        border: 1px solid #dcdfe6;
        box-sizing: border-box;
        color: #606266;
        display: inline-block;
        font-size: inherit;
        height: 40px;
        line-height: 40px;
        outline: none;
        padding: 0 15px;
        margin: 6px 12px;
      }

      .hotkey-settings__container .hotkey-settings__content .hotkey-button {
        display: inline-block;
        height: 40px;
        line-height: 40px;
        white-space: nowrap;
        cursor: pointer;
        border: 1px solid #409eff;
        -webkit-appearance: none;
        text-align: center;
        box-sizing: border-box;
        outline: none;
        margin: 0;
        transition: 0.1s;
        font-weight: 500;
        user-select: none;
        padding: 0 15px;
        font-size: 14px;
        border-radius: 4px;
        color: #fff;
        background-color: #409eff;
      }

      .hotkey-settings__container .hotkey-settings__content .hotkey-button:hover {
        opacity: 0.5;
      }
    `)
    }

    addHotkeyStyle()
    inttSettingsUI()

    // 判断是不是中文，如果是则直接return，否则执行
    if (!isChinesePage()) {
        // 创建网页元素方法
        function createElement(html, nodeText, attr, parent) {
            const element = document.createElement(nodeText)
            if (attr) {
                element[attr] = html
            } else {
                element.innerHTML = html
            }
            parent.appendChild(element)
        }

        // 初始化按钮位置
        setButtonPosition()
        //key.push('alt')
        // 初始化是否显示更好的翻译建议
        setShowTip()

        // 设置网页自动把 http 升级为 https
        // const e = document.createElement('meta')
        // e.setAttribute('http-equiv', 'Content-Security-Policy')
        // e.setAttribute('content', 'upgrade-insecure-requests')
        // head.appendChild(e)

        // 自定义样式，隐藏顶部栏
        GM_addStyle(`
      html,body{
        top: 0!important;
      }
      #google_translate_element {
        display: none;
      }
      .buttonContainer {
        width: 6em;
        position: fixed;
        bottom: 30px;
        z-index: 10000000;
        user-select: none;
        overflow: hidden;
        text-align: center;
        font-size: 13px;
        line-height: 2em;
        border-radius: 1em;
        box-shadow: 1px 1px 3px 0 #888;
        opacity: .5;
        transition: all .3s;
      }
      .recoverPage, .translateButton {
        float: left;
        width: 50%;
        box-sizing: border-box;
      }
      .recoverPage {
        border-radius: 1em 0 0 1rem;
        background-color: #fff;
      }
      .translateButton {
        color: #fff;
        border-radius: 0 1rem 1rem 0;
        background-color: #55b9f3;
      }
      .buttonContainer:hover {
        opacity: 1;
        transform: translateX(0);
      }
      .recoverPage:active, .translateButton:active {
        box-shadow: 1px 1px 3px 0 #888 inset;
      }
      /* 隐藏移动端顶部栏 */
      [id=":1.container"].skiptranslate {
        display: none;
      }
      /* 隐藏 PC 端顶部栏 */
      [id=":2.container"].skiptranslate {
        display: none;
      }
    `)

        // 创建容器
        createElement('google_translate_element', 'div', 'id', body)

        // 初始化
        createElement(
            `
      function googleTranslateElementInit() {
        new google.translate.TranslateElement(
          {
            pageLanguage: 'auto',
            includedLanguages: 'zh-CN',
            layout: /mobile/i.test(navigator.userAgent) ? 0 : 2
          },
          'google_translate_element'
        )
        // 清除图片的请求，加快访问速度
        let img = [].slice.call(document.querySelectorAll('#goog-gt- img,#google_translate_element img'))
        img.forEach(function (v) {
          const a = v
          a.src = ''
          let b = a.outerHTML.replace(/<img(.*?)>/, () => {
            return '<span id="lb"' + RegExp.$1 + '></span>'
          })
          const c = document.createElement('div')
          c.innerHTML = b
          a.parentNode.insertBefore(c.children[0], a.parentNode.children[0])
          a.remove()
        })
        // 获取设备信息
        const device = navigator.userAgent.indexOf('Mobile')
        // 按钮容器
        const buttonContainer = document.createElement('div')
       buttonContainer.setAttribute('class', 'notranslate buttonContainer')
        document.body.appendChild(buttonContainer)
        // 恢复按钮
        const recoverPage = document.createElement('div')
        recoverPage.setAttribute('id', 'recoverButton')
        recoverPage.setAttribute('class', 'notranslate recoverPage')
        recoverPage.innerText = '恢复'
        buttonContainer.appendChild(recoverPage)
        // 点击恢复原网页
        recoverPage.onclick = () => {
          let recoverIframe = null
          if (~device) {
            // 移动端
            const recoverDocument = document.getElementById(':1.container').contentWindow.document
            recoverDocument.getElementById(':1.restore').click()
          } else {
            // PC端
            const recoverDocument = document.getElementById(':2.container').contentWindow.document
            recoverDocument.getElementById(':2.restore').click()
          }
        }
        // 翻译按钮
        if (~device) {
          // 移动端
          let translateLang
          const translateTimer = setInterval(() => {
            translateLang = document.querySelector('.goog-te-combo')
            if (translateLang) {
              clearInterval(translateTimer)
              // 添加翻译按钮
              const translateButton = document.createElement('div')
              translateButton.setAttribute('id', 'translateButton')
              translateButton.setAttribute('class', 'notranslate translateButton')
              translateButton.innerText = '翻译'
              buttonContainer.appendChild(translateButton)
              // 点击翻译




              translateButton.onclick = () => {

                const event = document.createEvent('HTMLEvents')
               event.initEvent('change', true, true)
                event.eventType = 'message'
               document.querySelector('.goog-te-combo').dispatchEvent(event)
              }
                        translateButton.onclick()      // 无需点击 立即翻译
            }
                    translateButton.onclick()       // 无需点击 立即翻译
          }, 300)
          translateButton.onclick()
        } else {
          // PC端
          let langIframe = document.querySelector('[title="语言翻译微件"]')
          const langIframeTimer = setInterval(() => {
            if (langIframe) {
              const langDocument = langIframe.contentWindow.document || langIframe.contentDocument
              let translateLang
              const translateTimer = setInterval(() => {
                translateLang = langDocument.querySelectorAll('table a')[1]
                if (translateLang) {
                  clearInterval(translateTimer)
                  // 添加翻译按钮
                  const translateButton = document.createElement('div')
                  translateButton.setAttribute('id', 'translateButton')
                  translateButton.setAttribute('class', 'notranslate translateButton')
                  translateButton.innerText = '翻译'
                  buttonContainer.appendChild(translateButton)
                  // 点击翻译
                  //   // 无需点击 立即翻译 所有非中文网站，自动点击
                  translateLang.click()

                  translateButton.onclick = () => {
                    translateLang.click()
                  }
                }
              }, 300)
              clearInterval(langIframeTimer)
            } else {
              langIframe = document.querySelector('.goog-te-menu-frame')
            }
          }, 300)
        }
      // 删除元素
  const targetId = 'goog-gt-tt';
  const targetElement = document.getElementById(targetId);
  if (targetElement) {
    targetElement.remove();
  }
      }
    `,
            'script',
            '',
            head

        )

        // 导入翻译接口
        createElement(
            'https://translate.google.com/translate_a/element.js?&cb=googleTranslateElementInit',
            'script',
            'src',
            head
        )
        key.push('alt')
        // 排除一些代码的翻译
        const noTranslateArray = [
            '.bbCodeCode',
            'tt',
            'pre[translate="no"]',
            'pre',
            '.post_spoiler_show',
            '.c-article-section__content sub',
            '.c-article-section__content sup',
            '.c-article-equation',
            '.mathjax-tex'
        ]
        noTranslateArray.forEach(selectorName => {
            ;[...document.querySelectorAll(selectorName)].forEach(node => {
                if (node.className.indexOf('notranslate') === -1) {
                    node.classList.add('notranslate')
                }
            })
        })

        // 针对一些网站排除一些无需翻译的文字
        const noTranslateList = [
            {
                site: 'cratchapixel.com',
                selector: ['span.MathJax']
            }
        ]
        noTranslateList.forEach(item => {
            if (~document.domain.indexOf(item.site)) {
                item.selector.forEach(selectorName => {
                    let timer = null
                    let classList = document.querySelectorAll(selectorName)
                    if (!classList[0]) {
                        timer = setInterval(() => {
                            classList = document.querySelectorAll(selectorName)
                            if (classList[0]) {
                                clearInterval(timer)
                                    ;[...classList].forEach(node => {
                                        if (!~node.className.indexOf('notranslate')) {
                                            node.classList.add('notranslate')
                                        }
                                    })
                            }
                        })
                    }
                })
            }
        })

        // 解决一些网站开启脚本之后不能滚动
        function CanIScroll() {
            // 其它网站
            const noScrollSite = ['curseforge.com']
            noScrollSite.forEach(site => {
                if (~document.domain.indexOf(site)) {
                    GM_addStyle(`
            html {
              height: auto!important;
            }
          `)
                }
            })

            // 解决 gatesnotes.com 开启脚本之后不能滚动的问题,原理 z-index 太低导致
            if (~document.domain.indexOf('gatesnotes.com')) {
                GM_addStyle(`
          .TGN_site {
            z-index: 0!important;
          }
        `)
            }
        }
        CanIScroll()
    }

    // 添加支持作者弹框
    function addSupportDialog() {
        // 创建元素
        const wrap = document.createElement('div')
        wrap.id = 'k-support-wrap'
        wrap.className = 'k-support-wrap'
        const content = document.createElement('div')
        content.id = 'k-support-content'
        content.className = 'k-support-content'
        const title = document.createElement('div')
        title.className = 'k-support-title'
        title.textContent = '扫码打开小程序支持一下作者'
        const image = document.createElement('img')
        image.className = 'k-support-code'
        image.src = supportApplet
        image.alt = '支持作者小程序码'
        const close = document.createElement('div')
        close.className = 'k-support-close'
        close.textContent = '关闭'
        close.onclick = () => {
            wrap.classList.remove('show')
            content.classList.remove('show')
        }
        content.appendChild(title)
        content.appendChild(image)
        content.appendChild(close)
        wrap.appendChild(content)
        document.body.appendChild(wrap)

        // 添加样式
        GM_addStyle(`
      .k-support-wrap {
        position: fixed;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        z-index: 999999999;
        backdrop-filter: blur(10px);
        display: flex;
        justify-content: center;
        align-items: center;
        visibility: hidden;
      }

      .k-support-wrap.show {
        visibility: visible;
      }

      .k-support-wrap .k-support-content {
        padding: 20px;
        border-radius: 6px;
        box-shadow: 0 2px 12px 0 rgba(0, 0, 0, 10%);
        background-color: #fff;
        transform: scale(0);
        position: relative;
        transition: transform 0.3s;
        text-align: center;
      }

      .k-support-content.show {
        transform: scale(1);
      }

      .k-support-content .k-support-title {
        font-size: 24px;
      }

      .k-support-content .k-support-code {
        width: 250px;
        height: 250px;
        margin: 15px;
      }

      .k-support-content .k-support-close {
        width: 80px;
        height: 40px;
        line-height: 40px;
        cursor: pointer;
        border-radius: 6px;
        background-color: #F56C6C;
        margin: 0 auto;
        color: #fff;
      }

      .k-support-content .k-support-close:hover {
        opacity: 0.6;
      }
    `)
    }
    addSupportDialog()
})()
